import image7 from "./assets/img7.jpg";
import image8 from "./assets/img8.jpg";
import image9 from "./assets/img9.jpg";

const data3 = {
    productsBot: [
      {
        id: "7",
        name: 1,
        price: 15,
        image: image7,
      },
      {
        id: "8",
        name: 2,
        price: 15,
        image: image8,
      },
      {
        id: "9",
        name: 3,
        price: 15,
        image: image9,
      },
    ],
  };
  export default data3;
